import'./Chat.css'

function Chat(props){
    const[chat, setChat] = useState(<div></div>)
    function currentChat(id){
       if (id != -1){
        setChat(<div>AAAAAAAAAAAAAAA</div>)
       }
    }
    return(
        <div>
            {currentChat(props.id)}
            {chat}

            <input type="text"/>
        </div>
    )
}
export default Chat;
